INSERT INTO `wp_posts` VALUES (13,1,'2024-05-30 21:37:07','2024-05-30 21:37:07','<!-- wp:paragraph {\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"400\"}}} -->\n<p style=\"font-style:normal;font-weight:400\">At Coder\'s University, we take pride in not only cultivating academic excellence but also nurturing a holistic environment where learning extends beyond the classroom. Our university is not just a place of study; it\'s a vibrant community pulsating with a diverse array of events that cater to every passion and interest. From thought-provoking academic symposiums and engaging workshops to adrenaline-fueled hackathons and friendly gaming competitions, our events calendar is brimming with opportunities for you to explore, learn, and connect. Whether you\'re eager to delve deeper into your field of study, unleash your creativity, or simply unwind and have fun, there\'s something for everyone. Our commitment to fostering a rich tapestry of events reflects our belief in the power of experiential learning, collaboration, and personal growth. These events aren\'t just gatherings; they\'re transformative experiences that shape your journey through university and beyond.</p>\n<!-- /wp:paragraph -->','About Us','','publish','closed','closed','','about-us','','','2024-06-05 20:09:53','2024-06-05 20:09:53','',0,'http://localhost:10004/?page_id=13',0,'page','',0);
