INSERT INTO `wp_posts` VALUES (41,1,'2024-06-03 03:18:35','2024-06-03 03:18:35','<!-- wp:paragraph -->\n<p>We are thrilled to announce that Coder\'s University has been honored with the prestigious <em>Award</em> for Best Private <em>University</em>! This accolade is a testament to our commitment to excellence, innovation, and dedication in Education. Receiving this award is a significant milestone for us, reflecting the hard work and passion of our entire team. Our journey to this achievement has been marked by relentless effort, creativity, and collaboration. We are proud to be recognized for our contributions to [specific area or project], and this award inspires us to continue pushing the boundaries of what we can achieve. We extend our heartfelt gratitude to our faculty, staff, students, and partners whose unwavering support and belief in our vision have made this possible.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','We Won an Award!','We are thrilled to announce that Coder\'s University has been honored with the prestigious Award for Best Private University!','publish','open','open','','we-won-an-award','','','2024-06-05 19:59:03','2024-06-05 19:59:03','',0,'http://localhost:10004/?p=41',0,'post','',0);
